import React, { Component } from "react";


class RegisterPharmacies extends Component {
	state = {
		name: "",
		description: "",
		address: "",
		consulationPrice: "",
		openModalData: false,
		nameError: "none",
		addressError: "none",
		consulationPriceError: "none",
		openModal: false,
		coords: [],
        redirect: false,
        redirectUrl: '',
	};

}
